import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import HomePage from "../screening/home";
import pageNotFound from "../screening/notFound";
import Cart from "../screening/cartPage";
import Payment from "../screening/payment";
const appRouter = () => {
  return (
    <>
      <Router>
        <Switch>
          <Route exact={true} path="/payment"  render={(props) => <Payment {...props}/>} />
          <Route exact={true} path="/"><Payment /></Route>
          <Route element={<pageNotFound />}/>
          <Route exat={true} path="/cart" component={Cart} />
        </Switch>
      </Router>
    </>
  );
};
export default appRouter;
